import React from "react";
import Form from "./Components/Form";
// import NextPage from "./Components/NextPage";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
   return <>
   <Router>
      <Routes>
         <Route path="./Components/Form" element={< Form />} />
      </Routes>
   </Router>
   </>
}

export default App;
